import { StyleSheet } from 'react-native';

export default StyleSheet.create({
    container: {
        height: '100vh',
        width: '100%',
    },
    menuBar: {
        position: 'absolute',
        zIndex: 2,
    },
    titleContainer: {
        position: 'absolute',
        width: '100%',
        height: '70%',
        borderColor: 'black',
        borderWidth: '1px',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        zIndex: 1,
    },
    titleText: {
        fontSize: 30,
    }
});
